description:
Freshly dumped from the original game, one week before the official European release!

Seems that USB Loader GX can't load it at the moment (return immediatly to the Wii home screen).


****
WIA compressed image, must be converted to ISO or WBFS with tools like wit, see: &lt;a href=&quot;
http://wit.wiimm.de/info/wia.html&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://wit.wiimm.de/info/wia.html&lt;/a&gt;

to convert to iso:
wit copy &quot;The Legend of Zelda Skyward Sword [SOUP01].wia&quot; -d . -I

to wbfs:
wit copy &quot;The Legend of Zelda Skyward Sword [SOUP01].wia&quot; -d . -B
